import React from 'react';
import { Link } from 'react-router-dom';
import './AboutUs.css';

const videos = [
  {
    name: 'О нас',
    id: 1,
    path: '/about', // Путь для страницы "О нас"
  },
  {
    name: 'Запись',
    id: 2,
    path: '/how-to-register', // Путь для страницы "Как записаться?"
  },
  {
    name: 'А',
    id: 3,
    path: '/where', // Путь для страницы "Где проходит?"
  },
  {
    name: 'О преподавателе',
    id: 4,
    path: '/about-teacher', // Путь для страницы "О преподавателе"
  },
  {
    name: 'Контакты',
    id: 5,
    path: '/contacts', // Путь для страницы "Контакты"
  },
];

export function AboutUs() {
  return (
    <div className="video-list">
      <h1>About Us</h1>
      {videos.map((video) => (
        <div key={video.id} className="video-item">
          <div>
            <p className="video-name">{video.name}</p>
          </div>
          <Link to={video.path}>
            <button className="like-button">Узнать тут</button>
          </Link>
        </div>
      ))}
    </div>
  );
}
